import React from "react";
import "../styles/sendreceive.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPaperPlane } from "@fortawesome/free-solid-svg-icons";
import { faArrowAltCircleDown } from "@fortawesome/free-solid-svg-icons";
export const SendReceive = () => {
  return (
    <div className="containerSR">
      <div className="searchCodeContainer">
        <div className="inputBox">
          <span className="inputName">Aadhar Number</span>
          <input
            className="uidText"
            type="text"
            id="aadharNo"
            name="aadharNo"
            maxLength="12"
            value={aadharuid}
            onChange={(e) => {
              setAadharuid(e.target.value);
            }}
            required
            placeholder="Enter Aaadhar Number or VID"
          />
        </div>
      </div>
      <div className="sendReceiveContainer">
        <button className="srButton">
          <FontAwesomeIcon icon={faPaperPlane} size="2x" />
        </button>
        <button className="srButton">
          <FontAwesomeIcon icon={faArrowAltCircleDown} size="3x" />
        </button>
      </div>
    </div>
  );
};
